import "./TripStyles.css";
import TripData from "./TripData";
import Trip1 from "../assets/Beagle.jpg";
import Trip2 from "../assets/Poodle.jpg";
import Trip3 from "../assets/Yorkshire.jpg";

function Trip() {
  return (
    <div className="trip">
      <h1>Recent Pets</h1>
      <p>These pets recently added for adoption.</p>
      <div className="tripcard">
        <TripData image={Trip1} />
      </div>
    </div>
  );
}

export default Trip;
